-- ----------------------------
-- Table structure for tbl_siswa
-- ----------------------------
CREATE TABLE `tbl_siswa` (
  `nis` varchar(8) NOT NULL,
  `nama` varchar(100) NOT NULL,
  `jk` varchar(1) NOT NULL,
  `tgl_lahir` date DEFAULT NULL,
  `alamat` text,
  `agama` varchar(15) DEFAULT NULL,
  `kode_rombel` int(11) NOT NULL,
  `kode_rayon` varchar(5) NOT NULL,
  `tahun_masuk` varchar(4) DEFAULT NULL,
  `password` varchar(50) DEFAULT NULL,
  `tgl_update` timestamp NULL DEFAULT NULL,
  `user_update` varchar(50) DEFAULT NULL,
  `skor_p` int(3) DEFAULT NULL,
  `skor_r` int(3) DEFAULT NULL,
  `tanggal_kejadian` date DEFAULT NULL,
  `saksi` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`nis`),
  KEY `kode_rombel` (`kode_rombel`),
  KEY `kode_rayon` (`kode_rayon`),
  CONSTRAINT `tbl_siswa_ibfk_2` FOREIGN KEY (`kode_rayon`) REFERENCES `tbl_rayon` (`kode_rayon`),
  CONSTRAINT `tbl_siswa_ibfk_3` FOREIGN KEY (`kode_rombel`) REFERENCES `tbl_rombel` (`kode_rombel`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

